import React from "react";
import { Fragment } from "react/cjs/react.production.min";
import Logo from "../logo/logo";
import './footer.css';

const Foot=()=>{
return(
    <Fragment>
        <div className="foot_container">
            <div className="foot_logo">
                <Logo></Logo>
            </div>
        </div>
    </Fragment>
    );
};

export default Foot;
